import requests


def get_transaction_hex(txid: str) -> str:
    """Fetch raw transaction hex from mempool.space API."""
    url = f"https://mempool.space/api/tx/{txid}/hex"

    response = requests.get(url)

    if response.status_code == 200:
        return response.text.strip()  # Raw transaction hex
    else:
        return None  # Transaction not found or error


